import {
  SET_LOGIN_PENDING,
  SET_LOGIN_STATUS,
  SET_LOGIN_ERROR
} from ".store/actions/authActions";

const initialState = {
  email: "",
  password: ""
};

function auth(state = initialState, action) {
  switch (action.type) {
    case "LOGIN_USER":
      return {
        ...state,
        payload: action.payload
      };
    default:
      return state;
  }
}
